import React from "react";
import styled from "styled-components";
import { Doughnut } from "react-chartjs-2";

const PieChart = ({data, theImage}) => {
    const chartData = {
        datasets: [
            {
              data: data,
              backgroundColor: [
                'rgba(255, 99, 132, 0.5)',
                'rgba(54, 162, 235, 0.5)',
                'rgba(255, 206, 86, 0.5)',
                'rgba(75, 192, 192, 0.5)',
              ],
              borderWidth: 1,
            },
        ],
    }
}

const Section = styled.section`
    min-height: 100vh;
    width: 100%;
    background-color: ${props => props.theme.text};
    // color: ${props => props.theme.body};
    display: flex;
    justify-content: center;
    align-items: center;
    position: relative;
`;

const Title = styled.h1`
    font-size: ${props => props.theme.fontxxl};
    text-transform: capitalize;
    color: ${props => props.theme.body};
    // display: flex;
    // justify-content: center;
    // width: 100%;
    // text-align: center;
    // align-items: center;
    margin: 1rem auto;
    border-bottom: 1px solid ${props => props.theme.body};
    width: fit-content;
`;

const Tokenomics = () => {
    return (
        <Section>
            <Title>
                Tokenomics
            </Title>  
        </Section>
    );
}

export default Tokenomics;
